import './App.css';
import RulerRightLeft from './components/Ruler/RulerRightLeft';
import RulerTopBottom from './components/Ruler/RulerTopBottom';

function App() {
  return (
    <div className="App">
      <nav>
        <main>
          <div className="square">

            <RulerTopBottom />

            <div className="radarContainer">
              <div className="radar"></div>
              <div className="degreeLabel" id='top'>360</div>
              <div className="degreeLabel" id='right'>90</div>
              <div className="degreeLabel" id='bottom'>180</div>
              <div className="degreeLabel" id='left'>270</div>

              <div>
                {Array.from({ length: 36 }, (_, i) => (
                  <div
                    key={i}
                    className={`degreeMarking rotate-${i * 10}`}
                  ></div>
                ))}
              </div>
            </div>

            <RulerRightLeft />

            </div>


        </main>

        <aside>b</aside>
      </nav>

    </div >
  );
}

export default App;
